import React, { Component } from 'react';
import './signup.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Link} from 'react-router-dom';

class Signup extends Component {
    constructor(){
        state = {
            user:{
                username: 'nvjhvjh',
                email: '',
                password: ''
            }
        }
    }

    
    signUn(){

    }
    render(){
        const{user} =this.state;
        return (
        <div>
            <div className = "logo rounded mx-auto d-block">
                <img width="200" height="200" src="https://upload.wikimedia.org/wikipedia/en/thumb/e/ec/San_Jose_State_Spartans_logo.svg/378px-San_Jose_State_Spartans_logo.svg.png"
                alt = "SJSU SAMMY"/>
            <p className="h3 mb-3 text-center font-weight-bold">SJSU Bookhub</p>
            <link href="/docs/4.3/dist/css/bootstrap.min.css" rel="stylesheet" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossOrigin="anonymous"/>
            <link href="signin.css" rel="stylesheet"></link>
            <form className="form-signup">
            <img className="mb-4" src="/docs/4.3/assets/brand/bootstrap-solid.svg" alt="" width="72" height="72"/>
            <h1 className="text-center h4 mb-3 font-weight-normal">Sign Up</h1>
            <label htmlFor="inputPassword" className="sr-only">Username</label>
            <input type="name" id="inputPassword" className="form-control" onChange={e =>this.setState({user:{username: e.target.value}})} placeholder="Username" required autoFocus></input>
            <label htmlFor="inputEmail" className="sr-only">Email address</label>
            <input type="email" id="inputEmail" className="form-control" placeholder="Email address" required></input>
            <label htmlFor="inputPassword" className="sr-only">Password</label>
            <input type="password" id="inputPassword" className="form-control" placeholder="Password" required></input>
            <br/>
            {user.username}
            <button className="btn btn-lg btn-primary btn-block" onsubmit="signUp()" type="submit">Sign Up</button>
            <div className="mb-3">
                Already have an account? &nbsp;
                <Link to="/">
                Sign in
                </Link>
            </div>
            <p className="mt-5 mb-3 text-muted">&copy; SJSU 2019</p>
            </form>
            </div>
        </div>
        );
    }
}

export default Signup;
